import './App.css';
import {
  BrowserRouter,  
  Route,
  Link,  
  Routes,
} from 'react-router-dom';
import Rockets from './components/Rockets';
import Missions from './components/Rockets';
import MyProfile from './components/Rockets';

function App() {
  return (
    <>
      <BrowserRouter>
        <header>
          <Link to='/' >Rockets</Link>
          <Link to='/Missions'>Missions</Link>
          <Link to='/MyProfile'> My Profile</Link>
        </header>
        <Routes>
          <Route path='/'>
            <Rockets />
          </Route>
          <Route path='/Missions'>
            <Missions />
          </Route>
          <Route path='/MyProfile'>
            <MyProfile />
          </Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
